import React from "react";
import { Link } from "react-router-dom";

const Menu = () => {
  return (
    <nav>
      <Link to="/">|| HOME |</Link>
      <Link to="/about">|| ABOUT |</Link>
      <Link to="/faqs">|| FAQS |</Link>
      <Link to="/login">|| LOGIN |</Link>
    </nav>
  );
};

export default Menu;
